import React from 'react'
import Navbar from './HomePageNavbar';
import Banner from './Banner';
import Cook from './Cook';
import Service from './Service';

function HomePage() {
  return (
    <div>
        <Navbar/>
        <Banner/>
        <Cook/>
        <Service/>
    </div>
  )
}

export default HomePage;
